import logo from './logo.svg';
import './App.css';





function App() {
  const devices = ["iphone","mac" ,"samsung" ,"windows"]
  const devicesList = devices.map((device) => {
      return(<li>{device}</li>)
  })
  return (
    <div className="App" style={{marginTop:"100px", fontSize:"50px"}}>
        {devicesList}
    </div>


  );
}

export default App;
